#include <bits/stdc++.h>using namespace std; #define int long long int#define endl '\n'#define all(x) x.begin(), x.end() void solve(){    int n, m; cin >> n >> m;    vector<int> a(n), b(m), p, v;    for(int i = 0; i < n; i++){        cin >> a[i];        if(a[i] > a[0]) p.push_back(a[i]);    }    p.push_back(a[0]);    sort(all(p));        for(int i = 0; i < m; i++) cin >> b[i];     for(int i = 0; i < m; i++){        int pos = lower_bound(all(p), b[i]) - p.begin();        pos = p.size() - pos;         if(pos == (int)p.size()) v.push_back(1);        else v.push_back(pos + 1);    }     sort(all(v));     for(int i = 1; i <= m; i++){        int ans = 0;        for(int j = i - 1; j < m; j += i)            ans += v[j];         cout << ans << " ";    }     cout << endl;} int32_t main(){    ios_base::sync_with_stdio(0);    cin.tie(0);     int t = 1;    cin >> t;    while (t--)        solve();     return 0;}